ps = {(0,0): 1}
def p(n, k):
    """Number of partitions of n into exactly k parts"""
    if (n,k) in ps: return ps[(n,k)]
    if (n<=0) or (k<=0): return 0
    ps[(n,k)] = p(n-k,k) + p(n-1,k-1)
    return ps[(n,k)]
def a(n): return sum([p(2*n+1, k) for k in range(1,2*n+3,2)])
